import Routes from "./routes";

function App() {
  const questions = useSelector((state: TRootState) => state.questionTable);
  const { currentQuestionId } = useSelector(
    (state: TRootState) => state.examState
  );

  return (
    <div className="App">
      <Routes />
    </div>
  );
}

export default App;
